const MusicMakerContainer = ({ notes, arraysLists, instrumentLists, playSong, noteLength, stopBtn, copyNoteLength={copyNoteLength}}) => {
  return (
    <div id="mainGame" className="flex flex-col md:items-center   ">
        {/* <MusicMakerTop /> */}
